window.addEventListener("load",function(){$(document).ready(function(){let e=$("header.page-header ul.nav-tabs");if(e.length>0){0===$(e).find("li.active").length&&$(e).find("li").first().addClass("active")}let n=$(".resource-upload-field");if(n.length>0){let e=$(n).find(".error-block");e.length>0&&$(e).each(function(e,t){0===e?$(t).appendTo(n):$(t).remove()})}})});